import React from 'react';

function UploadText() {
    return ( 
        <div className='container'>
            <h1>
                Upload text
            </h1>
        <form>
            <div className="form-group">
                <input name="title" autoComplete="off" placeholder="Enter file title" className="form-control"></input>
            </div>

            <div className="form-group">
            <textarea placeholder="Enter text" autoComplete="off" name="text" className="form-control">

            </textarea>
            </div>

            <button className="btn btn-lg btn-info">UPLOAD</button>
        </form>
        </div>
    )};

export default UploadText;
